import React from 'react';
import {View, Text, StyleSheet,Image} from 'react-native';

export default function categoryCard(props){
    const {data}=props;
    return (
        <View style={styles.card}>
            <View style={styles.imageContainer}>
                <Image style={styles.image} source={require("../assets/wp2460316.jpg")}></Image>
            </View>
            <View style={styles.categoryContainer}>
                <Text style={styles.categoryText}></Text>
            </View>
        </View>
    )
}

const styles=StyleSheet.create({
    card:{
        flex:1,
        padding:10,
        elevation:1,
        borderBottomWidth:2,
        borderColor:"gray",
        justifyContent:"center",
        paddingBottom:15
    },
    imageContainer:{
        paddingRight:10,
        marginRight:10,
        paddingTop:5,
    },
    image:{
        flex:1
    },
    categoryContainer:{
        
    },
    categoryText:{
        fontWeight:"bold"
    }
})
